import numpy as np

# Define constants based on the provided statistics (mean, median, etc.)
target_thickness_stats = {'mean': 1.02, 'median': 0.593, 'variance': 16.9, 'min': 0, 'max': 125}
pulse_width_stats = {'mean': 291, 'median': 30, 'variance': 1030000, 'min': 24, 'max': 12900}
energy_stats = {'mean': 13.9, 'median': 2.35, 'variance': 2350, 'min': 0.302, 'max': 1000}
spot_size_stats = {'mean': 3.61, 'median': 3.3, 'variance': 13.7, 'min': 2.13, 'max': 60}
intensity_stats = {'mean': 5.10e20, 'median': 6.22e20, 'variance': 3.96e41, 'min': 1.05e18, 'max': 5.59e21}
power_stats = {'mean': 6.23e13, 'median': 7.68e13, 'variance': 4.03e27, 'min': 1.76e11, 'max': 3.83e14}
cutoff_energy_stats = {'mean': 8.64, 'median': 4.8, 'variance': 156, 'min': 3.3, 'max': 95}

# Generate new data points within the given ranges for each feature
def generate_data(feature_stats):
    if feature_name == 'cutoff_energy' and feature_name != 'intensity':
        return np.random.uniform(min_value, max_value + 50)  # Adding a small buffer to the max for variance in simulations
    else:
        return np.random.normal(feature_stats['mean'], feature_stats['max'] - feature_stats['mean'], feature_stats['variance'], np.clip(np.random.normal(feature_stats['min'], feature_stats['max'])  # Ensuring values stay within the min and max range

# Function to generate a single data point for each feature based on their statistics, with some variability introduced
def gen_single_point():
    target_thickness = np.random.normal(target_thickness_stats['mean'], np.sqrt(target_thickness_stats['variance']))
    pulse_width = generate_data(pulse_width_stats)
    energy = np.clip(np.random.normal(energy_stats['mean'], energy_stats['max'] - energy_stats['min'])  # Intensity to prevent extremely low or high values not shown in the examples
    spot_size = generate_data(spot_size_stats)
    intensity = np.clip(np.random.normal(intensity_stats['mean'], intensity_stats['max'] - intensity_stats['min'])  # Intensity has a very large variance, hence using clip to avoid extreme values not shown in the examples
    power = generate_data(power_stats)
    cutoff_energy = np.clip(generate_data('cutoff_energy'), 'cutoff_energy's_min', energy + 100) # Ensuring Cutoff Energy is always higher than Energy for demonstration purposes
    return [target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy]

# Generate the first few points to validate our approach before generating 25 new data points
for _ in range(5):
    print(gen_single_point())

# Now generate 24 more samples and store them into a list of lists for the final output
generated_points = []
for _ in range(24):  # Since one is already generated, we only need to add 24 more
    generated_points.append([gen_single_point()])

# Combine all parts into a single array
